import {  View, Text} from 'react-native';

const cartQuantity = (cartItemNumber) => {
    for(i=0; i>=0 ;i++) {
        cartItemNumber = cartItemNumber + i;
    };
    return(
        <View>
            <Text>{cartItemNumber}</Text>
        </View>
    );

}
